import styled from 'styled-components';

export const Wrapper = styled.div`
  width: 250px;
  display: flex;
  gap: 20px;
  justify-content: center;
  flex-wrap: wrap;
`;

export const Title = styled.h2`
  margin: 20px auto 0 auto;
  text-align: center;
`;
export const List = styled.ul`
  display: flex;
  gap: 40px;
`;

export const Btn = styled.button``;
